import TableOne from "./components/TableOne";
import TableTwo from "./components/TableTwo";
import PaginatedItems from "./components/"

function App() {

  return (
    <div class="row justify-content-center">
      <TableOne />
      <div class="col-md-9">
        <TableTwo />
        <PaginatedItems/>
      </div>
    </div>
  );
}

export default App;
